import axios from "axios";
import React from "react";

class ProfileItem extends React.Component {
  state = {
    listUser: [],
  }
  async componentDidMount() {
    let res = await axios.get(`/api/profile`);
    this.setState({
      listUser: res && res.data, 
    });
    console.log(res);
  }

  render() {
    return (
      <div>
        Hello
      </div>
    );
  }
}

export default ProfileItem;
